import React, { useState } from 'react';
import { Nav, NavItem, Dropdown, DropdownItem, DropdownToggle, DropdownMenu, NavLink } from 'reactstrap';
import './nav.css';
import Icon from './../CartIcon/CartonIcon.js';


const Example = (props) => {
  const [dropdownOpen, setDropdownOpen] = useState(false);

  const toggle = () => setDropdownOpen(!dropdownOpen);

  return (
    <div>

      <Nav pills className="nav p-2">
          <div className="col-3">
            <NavItem className="mr-2">
            <Icon/>
            </NavItem>
            </div>
            <div className="col-9">
              <NavItem >
                <NavLink className="buttonav" href="#" active>Home</NavLink>
              </NavItem>
              <NavItem>
                <NavLink className="itemnav" href="#">Products</NavLink>
              </NavItem>
              <NavItem>
                <NavLink className="itemnav" href="#">Contact</NavLink>
              </NavItem>
            </div>
      </Nav>

    </div>
  );
}

export default Example;
